pattern.text:
.hide-at-start,
    .comment-reply-form {
        display: none
    }

    .if-desktop {
        display: block
    }

    .if-mobile {
        display: none
    }

    .if-cookies-third,
    .if-cookies-no-third,
    .if-cookies-important,
    .if-cookies-no-important,
    .cookies,
    .cookies-settings {
        display: none
    }

    .splide:not(.is-active):not(.is-visible) .splide__slide:not(:first-child) {
        display: none
    }

    .splide {
        visibility: visible
    }

    .splide:not(.is-active):not(.is-visible) .splide__slide {
        width: 100%
    }

    .video-thumbnails.splide:not(.is-active):not(.is-visible) .splide__slide {
        width: 30%
    }

    .nobnr .sidebar__banner {
        display: none
    }

    .nobnr .banner__A_parent {
        display: none
    }

    @media only screen and (max-width:1199px) {
        .if-desktop {
            display: none
        }

        .if-mobile {
            display: block
        }

        #banner_30,
        #banner_69,
        #banner_50,
        #banner_51,
        #banner_79 {
            display: none
        }
    }

    @media only screen and (min-width:1199px) {

        #banner_94,
        #banner_95,
        #banner_96,
        #banner_97 {
            display: none
        }
    }

